import { useNavigate } from 'react-router-dom';
import avatar1 from "../../assets/images/users/avatar-1.jpg";
import { Container, Dropdown, Nav, Navbar } from 'react-bootstrap';

interface HeaderProps {
    toggleSidebar: () => void;
}

const Header = (props: HeaderProps) => {

    const navigate = useNavigate();

    const userData = JSON.parse(localStorage.getItem("UserData") || "{}");
    // alert("userData", userData);

    const logout = () => {
        localStorage.removeItem('UserData');
        localStorage.removeItem('token');
        localStorage.clear();
        navigate("/login");
    }

    return (
        <Navbar bg="light" variant="dark" expand="lg" className="px-3" style={{
            height: "72px", // same height as header
            backgroundColor: "#212529", // matches Bootstrap dark
        }}>
            <Container fluid>
                <button
                    className="btn btn-outline-light d-xl-none"
                    onClick={props.toggleSidebar}
                >
                    â˜°
                </button>
                <Navbar.Brand className="ms-2">My App</Navbar.Brand>
                <Nav className="ms-auto">
                    <Dropdown align="end">
                        <Dropdown.Toggle
                            variant="secondary"
                            id="dropdown-profile"
                            className="d-flex align-items-center"
                        >
                            <img
                                src="https://via.placeholder.com/30"
                                alt="profile"
                                className="rounded-circle me-2"
                            />
                            John Doe
                        </Dropdown.Toggle>
                        <Dropdown.Menu>
                            <Dropdown.Item href="#profile">Profile</Dropdown.Item>
                            <Dropdown.Item href="#settings">Settings</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item href="#logout">Logout</Dropdown.Item>
                        </Dropdown.Menu>
                    </Dropdown>
                </Nav>
            </Container>
        </Navbar>
    );
}

export default Header;
